function Dashboard() {
  return (
    <div className="h-screen w-screen">
      <HeaderTailwind></HeaderTailwind>
      <h2>Dashboard</h2>
    </div>
  );
}

function NotFound() {
  return (
    <div className="h-screen w-screen">
      <h2>Error 404</h2>
    </div>
  );
}
